import React from 'react';
import NavbarTop from './NavbarTop';
import lessonincomplete from '../img/lessonincomplete.svg';
import '../App.css';

function Dashboard() {
	return (
		<header>
			<NavbarTop />
			<h2>Dashboard</h2>
			{/* <div style={styles.lessonsElement}></div> */}
			<span style={styles.defaultFontFamily}>
				<img
					src={lessonincomplete}
					style={styles.lessonsElement}
					style={{ display: 'block' }}
				/>
				Lesson 1
			</span>
		</header>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	lessonsElement: {
		height: '10vmin'
	}
};
export default Dashboard;
